import React, { useEffect, useState } from "react";
import styled from "styled-components";
import DatePicker from 'react-date-picker'

const Container = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: space-around;
  align-items: center;
  margin: 0 auto;
`;
const Title = styled.h1`
  color: black;
`;
export default () => {
  const [test, setTest] = useState<any>({});

  //FIXME: API DATA WEBSITE === https://api.nasa.gov/index.html
  const API_KEY: string = "api_key=J9c8DvGBTzcqvhFd8UPQIJqhzJ80Ractk3JBOiRx";
  const baseUrl = "https://api.nasa.gov";
  const fetchData = async () => {
    const response = await fetch(
      `${baseUrl}/planetary/apod?date=1996-03-06&${API_KEY}`
    );
    const data = await response.json();
    setTest(data);

    console.log("datos", test);
  };

  useEffect(() => {
    fetchData();
  }, []);
  return (
    <div>
      <Container>
        <Title onClick={() => fetchData()}>Api Connected Website</Title>{" "}
        <Title> Astronomy Picture of the Day (set day)</Title>
        <DatePicker />
        <img src={`${test.url}`} />
      </Container>
    </div>
  );
};
